import { NavLink } from "react-router-dom";
import "../assets/css/login.css";

const navLinks = [
  { to: "/dashboard", label: "My Account" },
  { to: "/history", label: "Rides" },
  { to: "/payments", label: "Payments" },
  { to: "/", label: "Logout", className: "logout-link" }
];

const Navbar = () => (
  <nav className="customer-navbar">
    <div className="customer-navbar-brand">Elsparkcyklar</div>
    <div className="customer-navbar-links">
      {navLinks.map(link => (
        <NavLink
          key={link.to}
          to={link.to}
          className={({ isActive }) =>
            "customer-navbar-link" +
            (isActive ? " active" : "") +
            (link.className ? " " + link.className : "")
          }
        >
          {link.label}
        </NavLink>
      ))}
    </div>
  </nav>
);

export default Navbar;
